    "desc_para1": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "\u0414\u044F\u043A\u0443\u0454\u043C\u043E \u0437\u0430 \u0432\u0430\u0448 \u0456\u043D\u0442\u0435\u0440\u0435\u0441 \u0434\u043E \u0432\u0438\u043F\u0440\u043E\u0431\u0443\u0432\u0430\u043D\u043D\u044F Elk, \u043D\u0430\u0448\u043E\u0433\u043E \u0443\u043D\u0456\u0432\u0435\u0440\u0441\u0430\u043B\u044C\u043D\u043E\u0433\u043E \u043A\u043B\u0456\u0454\u043D\u0442\u0430 Mastodon, \u044F\u043A\u0438\u0439 \u0449\u0435 \u0443 \u0440\u043E\u0437\u0440\u043E\u0431\u0446\u0456!" } },
